import { NgForm } from '@angular/forms';
import { Router } from '@angular/router';
import { UserDataService } from 'src/app/services/user/userData/user-data.service';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})
export class RegisterComponent {
  userData={
    name:'',
    email:'',
    password:'',
    address:{
      city:'',
    },
    gender:'',
    userType:'',
  }
  msgError = null
  constructor(private user : UserDataService , private router : Router){}
  handleSubmit(form : NgForm){
    console.log(form)
    if(form.valid){
      this.user.register(this.model).subscribe(res=>{
        console.log(res)

        if(res.status) this.router.navigateByUrl('/gallery')

      }, (e)=>{
        console.log(e.error.message)
        this.msgError = e.error.message
      })
    }
  }
}
